import React from 'react';


class Stable extends React.Component {
    async gettingSoldiers() {
        const api_url = await
        fetch("http://localhost:7001/soldier/all",{mode: 'no-cors'});
        const dataa = await api_url.json();
        console.log(dataa);
    };

    render() {
        return (
            <div>
                <button onClick={this.gettingSoldiers}>{}</button>
            </div>
        )
    }
}

export default Stable;
